    #print(boards.shape)
    #print(boards[0])
    ys = numpy.zeros((boards.shape[0],1))
    s = 10 * cntdis
    score = 1000
    print("Score:"+str(s))
    max_epoch = 3
    dis = s / ys.shape[0]
    for i in range(len(ys)):
        ys[i][0] = score + dis
        score += dis
        #score *= dis
        #print(boards.shape)
        #print(ys)
    
    evals = sess.run(model.y, feed_dict={model.x:boards, model.y_:numpy.zeros(ys.shape), model.keep_prob:1.0})
    print(evals)
    print(" ")
    for epoch in range(max_epoch):
        sess.run(model.train_step,feed_dict={model.x:boards, model.y_:ys,model.keep_prob:0.95})
    evals = sess.run(model.y, feed_dict={model.x:boards, model.y_:numpy.zeros(ys.shape), model.keep_prob:1.0})
    print(evals)
    
